import React from "react";
import styled from "styled-components";
import HomeIcon from "@mui/icons-material/Home";

function Header() {
  return (
    <Container>
      <a>
        <HomeIcon />
      </a>
      <Menu></Menu>
    </Container>
  );
}

export default Header;

const Container = styled.div`
  min-height: 40px;
  position: fixed;
  display: flex;
  align-items: center;
  padding: 0 20px;
`;

const Menu = styled.div``;
